class Solution:
    
    def clear_path_tiles(self, row:int, col:int) -> Dict[int, Dict[int, bool]]:
        path_tiles = {}
        for r in range(1,row+1):
            path_tiles[r] = {}
            for c in range(1,col+1):
                path_tiles[r][c] = False
        return path_tiles
    
    def clear_dont_use_tiles(self, row, col):
        dont_use_tiles = {}
        for r in range(1,row+1):
            dont_use_tiles[r] = {}
            for c in range(1,col+1):
                dont_use_tiles[r][c] = False
            for c in [0, col+1]:
                dont_use_tiles[r][c] = True
        
        for r in [0, row+1]:
            dont_use_tiles[r] = {}
            for c in range(0, col+2):
                dont_use_tiles[r][c] = True
        return dont_use_tiles

    def linear_search(self, row: int, col: int, cells: List[List[int]]):
        dont_use_tiles: Dict[int, Dict[int, bool]] = self.clear_dont_use_tiles(col=col, row=row)
        # self.make_out_of_bounds(row=row, col=col)
        # for r in range(0,row+2):
        #     for c in range(0, col+2):
        #         print(self.out_of_bounds_dict[r][c],end="")
        #     print()
        # exit()
        # path = self.find_path(row=row, col=col, day=0, cells=cells, dont_use_tiles=dont_use_tiles)
        path_tiles = self.find_path(row=row, col=col, day=0, cells=cells, dont_use_tiles=dont_use_tiles)
        # print(path_tiles)

        for day in range(0,len(cells)):
            
            flooding_tile = cells[day]

            dont_use_tiles[flooding_tile[0]][flooding_tile[1]] = True

            if path_tiles[flooding_tile[0]][flooding_tile[1]] == True:
                path_tiles = self.find_path(row=row, col=col, day=day, cells=cells, dont_use_tiles=dont_use_tiles)

            # if cells[day] in path:
                # path = self.find_path(row=row, col=col, day=day, cells=cells, dont_use_tiles=dont_use_tiles)

            if path_tiles == None:
                dont_use_tiles=self.clear_dont_use_tiles(col=col, row=row)
                path_tiles = self.clear_path_tiles(col=col, row=row)
                for index in range(len(cells[0:day+1])):
                    dont_use_tiles[cells[index][0]][cells[index][1]] = True
                path_tiles = self.find_path(row=row, col=col, day=day, cells=cells, dont_use_tiles=dont_use_tiles)
                if path_tiles == None:
                    return day

    def binary_search(self, row: int, col: int, cells: List[List[int]]):
        dont_use_tiles: Dict[int, Dict[int, bool]] = self.clear_dont_use_tiles(col=col, row=row)
        # self.make_out_of_bounds(row=row, col=col)
        # for r in range(0,row+2):
        #     for c in range(0, col+2):
        #         print(self.out_of_bounds_dict[r][c],end="")
        #     print()
        # exit()
        # path = self.find_path(row=row, col=col, day=0, cells=cells, dont_use_tiles=dont_use_tiles)
        path = self.find_path(row=row, col=col, day=0, cells=cells, dont_use_tiles=dont_use_tiles)
        # print(path_tiles)

        max_search = len(cells)
        min_search = 0
        break_condition = True
        while break_condition:
            day = int((max_search-min_search)/2)+min_search
            # print(day)
            dont_use_tiles=self.clear_dont_use_tiles(col=col, row=row)
            path_tiles = self.clear_path_tiles(col=col, row=row)
            for index in range(len(cells[0:day+1])):
                dont_use_tiles[cells[index][0]][cells[index][1]] = True
            path = self.find_path(row=row, col=col, day=day, cells=cells, dont_use_tiles=dont_use_tiles)
            # print(path)
            if path == None:
                max_search = day
            if path != None:
                min_search = day
            if max_search-min_search==1:
                return max_search

    def latestDayToCross(self, row: int, col: int, cells: List[List[int]]) -> int:
        # return self.linear_search(row, col, cells)
        return self.binary_search(row, col, cells)
    
    def find_path(self, row: int, col: int, day: int, cells: List[List[int]], dont_use_tiles: Dict[int, Dict[int, bool]]) -> Dict[int, Dict[int, bool]]:
        path_tiles = self.clear_path_tiles(row=row, col=col)
        path = []
        for tile in range(1,col+1):
            if not dont_use_tiles[1][tile]:
                path_tiles[1][tile] = True
                path.append([1,tile])
                while sum(path_tiles[row].values())==0:
                    tile = self.get_next_step(path=path, path_tiles = path_tiles, day=day, row=row, col=col, cells=cells, dont_use_tiles=dont_use_tiles)

                    if tile != None:    
                        path.append(self.get_next_step(path=path, day=day, path_tiles = path_tiles, row=row, col=col, cells=cells, dont_use_tiles=dont_use_tiles))
                        path_tiles[tile[0]][tile[1]] = True
                    else:
                        temp = path[-1]
                        dont_use_tiles[temp[0]][temp[1]] = True
                        path.pop()
                        path_tiles[temp[0]][temp[1]] = False
                        
                        if len(path) == 0:
                            break
                    
                if len(path)>0 and path[-1][0] == row:
                    return path

            path = []

        return None

    def get_next_step(self, path:List[List[int]], day:int, path_tiles, row:int, col:int, cells:List[List[int]], dont_use_tiles:Dict[int, Dict[int, bool]]) -> List[int]:
        current_tile = path[-1]
        neighbors = self.get_neighbors(current_tile=current_tile, day=day, row=row, col=col, dont_use_tiles=dont_use_tiles)
        if neighbors == None:
            return None
        else:
            for neighbor in neighbors:
                if not path_tiles[neighbor[0]][neighbor[1]]:
                # if not neighbor in path:
                    return neighbor
                
    def outside_bounds(self, tile:List[int], row:int, col:int):
        # return self.out_of_bounds_dict[tile[0]][tile[1]]

        if tile[0] == 0 or tile[0]>row:
            return True
        if tile[1] == 0 or tile[1]>col:
            return True
        return False

    def get_neighbors(self, current_tile:List[int], day:int, row:int, col:int, dont_use_tiles:Dict[int, Dict[int, bool]]):
        neighbors:List[List[int]] = []

        for test_step in [[1,0],[0,-1],[0,1],[-1,0]]:
            test_tile = [current_tile[0] + test_step[0], current_tile[1] + test_step[1]]
            # if not self.outside_bounds(tile=test_tile, row=row, col=col):
            if not dont_use_tiles[test_tile[0]][test_tile[1]]:
                neighbors.append(test_tile)
            else:
                pass

        if len(neighbors)>1:
            return neighbors        
        elif len(neighbors)>0 and current_tile[0]==1:
            return neighbors
        else:
            return None


